// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { autoSaveContextRenderFunction } from 'js/autoSaveContextService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/autoSaveContextService', () => import('js/autoSaveContextService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "autoSaveContextRenderFunction",
            "deps": "js/autoSaveContextService"
        }
    },
    "data": {
        "tooltip": {
            "title": "{{i18n.AUTO_SAVE_TITLE}}",
            "description": "{{i18n.AUTO_SAVE_DESCRIPTION}}"
        }
    },
    "i18n": {
        "AUTO_SAVE_TITLE": [
            "BaseMessages"
        ],
        "AUTO_SAVE_DESCRIPTION": [
            "BaseMessages"
        ]
    },
    "ctxFields": [
        "autoSave"
    ],
    "ctx": {
        "autoSave": null
    },
    "lifecycleHooks": {
        "render": "render"
    },
    "_viewModelId": "autoSaveContext",
    "_uniqueViewModelId": "autoSaveContext"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, autoSaveContextRenderFunction, undefined, ctxImportObj );

export default Component;
